import React from "react";
import MyForm from "./MyForm";

const FormInput = props =>{
    return (
      <form>
        <div>
          <MyForm title="Title" type="text" />
        </div>
        <div>
          <MyForm label="Opening Text" textarea ="textarea"/>
        </div>
        <MyForm title ="Release Date" type ="text"/>
      </form>
    );
}
export default FormInput;
